import MovieCard from "../Components/MovieCard";
import {db} from "../Config"


const screenHeight = Dimensions.get("window").height;

function mapStateToProps(state){
  return {menu:state.menu}
}

function mapDispatchToProps(dispatch){
 return { 
    openMenu: () => dispatch({
      type : "OPENMENU"
    }) 
       
    }
 
}


class HomeScreen extends React.Component {

  state = {
    testname : "Lets Start",
    top: new Animated.Value(screenHeight),
    opacity: new Animated.Value(1)

  }

  componentDidUpdate(){
    this.blackScreen()
  
  }

  componentDidMount(){
  this.database = db.ref().child("MediumBannerData")
    this.database.on("value", (snap) =>{
      let MedBannerFinalData = [];
     snap.forEach(child => {

      MedBannerFinalData.push({
        title: child.val().Title,
        MediumBannerImage:child.val().MediumBannerImage
      });
     });
      console.log(MedBannerFinalData);

    })
    
  }


  blackScreen(){
    if(this.props.menu =="openMenu"){
      
      Animated.timing(this.state.top, {toValue:0, duration:10, useNativeDriver:true}).start();
      Animated.timing(this.state.opacity, {toValue:0.6, duration:500, useNativeDriver:true}).start();
    }
    if(this.props.menu =="closeMenu"){
      Animated.timing(this.state.top, {toValue:screenHeight,duration:10, useNativeDriver:true}).start();
      Animated.timing(this.state.opacity, {toValue:0}).start();

    }
  }
  render() {
    return (
      <Root>
     <View  style = {styles.container} >
     
       <ScrollView showsVerticalScrollIndicator={false}>
      <StatusBar hidden/>
       <View style = {styles.headerStyle} >
         <TouchableOpacity  style = {{position:"absolute", top:15, left:10, zIndex: 100}} onPress = { this.props.openMenu} >
         <Ionicons name= "ios-menu" size = {25} color ="black"/>
         </TouchableOpacity>
      
       <Text style ={styles.AppTitle }>CLIPS</Text>
       <Image style = {styles.LogoStyle}  source = {require("../assets/Appicon.png")} />
   
       <Text style ={styles.TextStyle } style = {{right: 70,   top: 14, position: "absolute",}}>Hi Raja</Text>
      <Image style = {styles.circularImageView}  source = {{
        uri:"https://lh3.googleusercontent.com/-Nlsp3xGAyDQ/WkICQ-zuzAI/AAAAAAAAGSI/5KyDhehUXvY7RFWrMHBySIahd5AfIkUWgCEwYBhgLKtQDAL1OcqzP0LqJEXCLDNaIbL3b6PMQwXo_nsIpsfFNELxRD21Gs88rUSbsydgSVWhU_CIGed51ExYhhQGdBwhM7WJi0AlCKLdAF3TYaUr5Y1ylXNyQRw3E8fcf1xs0e6kVqGvlEu-ckZRVy60Ke4l89zezpH3iBv6rIsJLbHESZKbJ-PVnjs4TDLfrNebH3X5qPzVqreAudOwMY_iL1RlDfqVm1FzxymYg9Xv1paqoT744jLrwz6FXuHdfRr7VsDY5vrW3XLcaTkVCpeOihiVJikW632YVrP_T5f3krdyG7DDJOuiYqNOZLLCHu4f-0RKOX1dXGWyviPWNgySW_nnXOT8cVkSC6mzRg3yMwDWz5MFfrsXcrGtIhWZ1J7s3dCpMrUSSxNRryDRng-Jpw41-O1XHimAoNLmkcKpa2fMNog4LsCAZIo8DsbtbN81xZ1AGWRpR4HASMl6TmwJ6DfJBEWT5QC4fyM_sHNY1KeL2IYRuvle-MMo1Q0Y8K-f2QT31QTh5V71bTEEDlDtpPlcIUDALjFdRvUfvpW80uMFcQaF8SYtGW-sPKxcLnfFrJPs3NKHclstBG8s4P--uhq-izQLEt6r7cOE95lneQpa3T6EpkDrsMNqm__0F/w140-h140-p/7202b9c5-32c9-476b-bcfe-b5a66e307b7c"}} />
     </View>
     
     <View  style = {styles.containerStyle}>
       <ScrollView horizontal = {true} showsHorizontalScrollIndicator ={false}> 
     {
       BigBannerData.map((data ,index)=> {
         return <BigBanner key={index} image = { data.image}/>;

      
       })
     }
 
       </ScrollView>
     </View>

    <AppTextView  name = "Continue Watching"/>
    <ScrollView horizontal = {true} showsHorizontalScrollIndicator ={false}> 
   
    {MediumBannerData.map((data,index) => {
      return <TouchableOpacity   key ={index} onPress = { ()=> {
        this.props.navigation.navigate("VideoActivity",
        {
          video: data,
          datas: MediumBannerData,
          movieData:MenuCardData,
        });
      }} > 
       <MediumBanner image = {data.MediumBannerImage} />
       </TouchableOpacity>
    })}
    </ScrollView>


    <AppTextView  name = "You may like also"/>
    <ScrollView horizontal = {true} showsHorizontalScrollIndicator ={false}> 
   
    {MenuCardData.map((data,index) => {
      return <TouchableOpacity   key ={index} onPress = { ()=> {
        this.props.navigation.navigate("VideoActivity",
        {
          video: data,
          datas: MediumBannerData,
          movieData:MenuCardData,
        });
      }} > 
       <MovieCard image = {data.MediumBannerImage} />
       </TouchableOpacity>
    })}
    </ScrollView>

     </ScrollView>
       </View>
    
       {/* <AnimatatedBlack style = {{top:this.state.top, opacity: this.state.opacity}}/> */}
    
       <Animated.View  style = {{opacity: this.state.opacity,position: "absolute" ,width:"100%", height: "100%",backgroundColor: Black, transform :[{translateY : this.state.top
              }]}} />
       <Menu />
       </Root>
  
  
    );
  }
 
}


